    super();
    this.state = {

      totalFlip: 0,
      headFlip: 0,
      tailFlip: 0,
    }
  }
  render() {
    return (
      <div className="App" >
        <div>
          <h1>Let's flip a coin!</h1>
          <FlipCoin></FlipCoin>
          <Action></Action>
